define([],function(){var n={};return n["date-range-selection"]='<div class="dialog">\r\n    <div class="caption">\r\n        בחירת טווח תאריכים\r\n    </div>\r\n    <div v-if="maxDaysDiff > 0" style="text-align: center; font-size: 12px; font-weight: bold;"\r\n         v-bind:style="{color: maxDiffReached() ? \'red\' : \'#666\'}">\r\n        (הפרש: עד {{maxDaysDiff}} ימים)\r\n    </div>\r\n    <div class="pb-md ph-sm">\r\n        <p>\r\n            תאריך התחלה:\r\n            <input type="date" v-model="startDate" style="float: left;" />\r\n        </p>\r\n        <div style="clear: both;"></div>\r\n        <p>\r\n            תאריך סיום:\r\n            <input type="date" v-model="endDate" style="float: left;" />\r\n        </p>\r\n        <div style="clear: both;"></div>\r\n    </div>\r\n    <div class="pb-md ph-sm" v-if="allowUnlimited">\r\n        <button class="btn blue" style="font-weight: bold;" v-on:click="setUnlimited()">ללא הגבלת זמן</button>\r\n    </div>\r\n    <div class="pb-md" style="text-align: center;">\r\n        <button class="btn red" v-on:click="cancel()">ביטול</button>\r\n        <button class="btn" v-bind:disabled="confirmDisabled()" v-on:click="confirm()">אישור</button>\r\n    </div>\r\n</div>',n["error-message"]='<div class="dialog">\r\n    <div class="caption">\r\n        {{caption}}\r\n    </div>\r\n    <div class="pb-md">\r\n        <p class="alert">{{message}}</p>\r\n    </div>\r\n    <div class="pb-md" style="text-align: center;">\r\n        <button class="btn wide red" v-on:click="close()" autofocus>אישור</button>\r\n    </div>\r\n</div>',n["message-box"]='<div class="dialog" v-bind:class="{wide: wide}">\r\n    <div class="caption">\r\n        {{caption}}\r\n    </div>\r\n    <div class="pb-md ph-sm" style="max-height: 400px; overflow: auto;">\r\n        <p v-html="message"></p>\r\n    </div>\r\n    <div class="pb-md" style="text-align: center;">\r\n        <button v-if="cancelText != null" class="btn" v-bind:class="{red: alert, wide: confirmText == null, medium: confirmText != null}" v-on:click="cancel()">{{cancelText}}</button>\r\n        <button v-if="confirmText != null" class="btn" v-bind:class="{wide: cancelText == null, medium: cancelText != null}" v-on:click="confirm()">{{confirmText}}</button>\r\n    </div>\r\n</div>',n["password-validation"]='<div class="dialog">\r\n    <div class="float-left clickable" v-on:click="cancel">&#x2715;</div>\r\n    <div class="caption">\r\n        {{caption}}\r\n    </div>\r\n    <form>\r\n        <div class="pv-md">\r\n            <div style="position: relative; width: 240px; margin: 0px auto;">\r\n                <input type="password" autofocus style="width: 100px; text-align: center; padding-left: 70px; padding-right: 70px;" v-model="password">\r\n                <div style="position: absolute; top: 3px; right: 4px;">סיסמה</div>\r\n            </div>\r\n        </div>\r\n        <div class="pb-md" style="text-align: center;">\r\n            <button class="btn wide" v-on:click="confirm()" v-bind:disabled="password == \'\'">אישור</button>\r\n        </div>\r\n    </form>\r\n</div>',n});